-- ----------------------------
-- Table structure for `base_user`
-- ----------------------------
DROP TABLE IF EXISTS `base_user`;
CREATE TABLE `base_user` (
  `id` int(5) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `username` varchar(50) NOT NULL COMMENT '用户名',
  `password` varchar(255) NOT NULL COMMENT '密码',
  `type` mediumint(2) NOT NULL DEFAULT '2' COMMENT '用户类型：0-管理员 1-教师 2-学生/家长/游客',
  `sex` varchar(20) DEFAULT '男' COMMENT '用户性别(男/女)',
  `age` mediumint(2) DEFAULT NULL COMMENT '用户年龄',
  `email` varchar(20) DEFAULT NULL COMMENT '用户邮箱(管理员可以没有email)',
  `phone` varchar(11) DEFAULT NULL COMMENT '用户手机号码(管理员可以不设置)',
  `level` varchar(20) DEFAULT '大学' COMMENT '学历等级',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='用户基本信息表';

