DROP TABLE IF EXISTS `detail_user_student`;
CREATE TABLE `detail_user_student` (
  `name` varchar(50) NOT NULL,
  `realname` varchar(10) NOT NULL,
  `type` mediumint(2) NOT NULL COMMENT '1-教师 2-学生',
  `level` varchar(20) NOT NULL,
  `introduction` varchar(255) NOT NULL,
  `address` varchar(255) NOT NULL COMMENT '家庭住址',
  `image` longblob NOT NULL,
  `subject` varchar(100) NOT NULL COMMENT '薄弱科目',
  `isonline` mediumint(2) NOT NULL DEFAULT '0' COMMENT '0-不在线 1-在线',
  `price` varchar(50) NOT NULL,
  `city` varchar(20) NOT NULL COMMENT '城市',
